import React, { Component } from 'react';
import { connect } from 'react-redux';

class DailyView extends Component {
  componentDidUpdate() {
    console.log(this.props.weatherDailyData.daily);
  }

  renderInput() {
    if (Object.keys(this.props.weather).length === 0) {
      return 'Daily View';
    }

    return;
  }

  render() {
    return <div>Daily View</div>;
  }
}

const mapStateToProps = state => {
  return { weatherDailyData: state.weather.data };
};

export default connect(mapStateToProps)(DailyView);
